// KanbanColumnContainer.js
import React from "react";
import KanbanColumn from "./KanbanColumn";

const KanbanColumnContainer = ({ containerTitle, tasks }) => {
  return (
    <div className="kanban-column-container">
      <h2>{containerTitle}</h2>
      <KanbanColumn columnId="columnId1" tasks={tasks} />
      <KanbanColumn columnId="columnId2" tasks={tasks} />
      <KanbanColumn columnId="columnId3" tasks={tasks} />
    </div>
  );
};

export default KanbanColumnContainer;
